import products from '../../products';

function SpicyFood() {
  return (
    <div>
    <div className='text-center'>
     <h1 className='menu' style={{color:'purple'}}>Spicy Foods</h1> 
  
    </div>
    <div className='row mt-5'>
     <div className='col-md-4'>
     <img></img>
     </div>
    </div>
    </div>
  )
}

export default SpicyFood
